import React from "react";
import "./CheckoutProduct.css";

function CheckoutProduct() {
  return (
    <div className="checkoutproduct">
      <div className="container">
        <table>
          <thead>
            <tr>
              <th>Product</th>
              <th>Quentity</th>
              <th>Price</th>
              <th>Product</th>
            </tr>
          </thead>
        </table>
      </div>
    </div>
  );
}

export default CheckoutProduct;
